import React from "react";
import "./Read.css";

function View({ content, handleDelete, idx, handleUpdate, handleFilter }) {
  return (
    <div className="View">
      <div className="View__item">
        <li className="View__list" key={content.id}>
          <div className="username">{content.username}</div>
          <div
            className="title"
            onClick={() => handleFilter(content.username, idx)}
          >
            {content.title}
          </div>
          <div className="content">{content.content}</div>
          <div className="createAt">{content.createdAt}</div>
        </li>
      </div>
      <div className="View__btns">
        <button
          className="수정"
          onClick={() => handleUpdate(content.username, idx)}
        >
          수정
        </button>
        <button
          className="삭제"
          onClick={() => handleDelete(content.username, idx)}
        >
          삭제
        </button>
      </div>
    </div>
  );
}

export default View;
